import React, { useState } from "react";
import "./App.css";
import ALayout from "./components/aLayout";
import TestContentPanel3 from "./components/testContentPanel3";
import { createTheme, ThemeProvider } from "@material-ui/core/styles";

const theme = createTheme({
  palette: {
    primary: {
      main: "rgb(53, 188, 238)",
      light: "rgb(53, 188, 238)",
    },
    secondary: {
      main: "rgb(46, 48, 73)",
      light: "rgb(46, 48, 73)",
    },
  },
  typography: {
    fontSize: 12,
    body1: {
      color: "rgba()"
    }
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <ALayout contentPanel={<TestContentPanel3 />} />
      </div>
    </ThemeProvider>
  );
}

export default App;
